import{useState} from 'react';
import './App.css';

function App() {

  const [myNum, setNum] = useState(2)
  const [username , setUsername] = useState('Lets count by 3s')

  return (
   <>
   <main>

    <h1> {myNum} </h1>
    <button onClick ={() => setNum(myNum => myNum + 3)}> 
    Submit
    </button>

    <h1>{username}</h1>
    <input name ="username" value = {"username"}></input>
    <button onClick ={() => setUsername(username => 'Enjoy Counting')}>
      Click me
    </button>
   </main>
   </>
  );
}

export default App;
